import React, { Component } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import "./App.css";
import Login from "./Login.js";
import SignUp from "./SignUp.js";
import LargeLogo from "./virtualstacklogo.png";
import Button from "react-bootstrap/button";

class LandingPage extends Component {
  onSubmit = () => {
    this.props.history.push("/signin");
  };

  render() {
    return (
      <div class="login-header">
        <div id="large-logo">
          <img src={LargeLogo} alt="LargeLogo" />
        </div>
        <br />
        <Router>
          <div>
            <nav class="landing-buttons">
              <Link to="/signin" onClick={this.props.closeCallback}>
                <Button variant="primary" onClick="onSubmit" block>
                  Login
                </Button>
              </Link>
              <br />
              <Link to="/signup" onClick={this.props.closeCallback}>
                <Button variant="success" block>
                  Sign Up
                </Button>
              </Link>
            </nav>
          </div>
        </Router>
      </div>
    );
  }
}

export default LandingPage;
